'''Algebra''' (from the [[Arabic language|Arabic]] الجبر ("''al-djebr''" meaning ''"reunion"'', ''"connection"'' or ''"completion"'')) is a branch of [[mathematics]] which may be defined as a generalization and extension of and is focused on finding patterns between groups of numbers, operators, and other mathematical objects. The following category includes articles about algebra. Algebra is also a branch of mathematics that substitutes letters for numbers, replacing the unknown value with a letter. 

